import React from "react";
import { connect } from "react-redux";
import * as actions from "../actions/createContact";

const CreateContact = (props) => {
  return (
    <div>
      Add New Contact
    </div>
  );
}

const mapStateToProps = state => ({
  createContactList : state.createContact.list
})

const mapActionToProps = {
  fetchAllCreateContact : actions.fetchAll
}

export default connect(mapmapActionToProps)(CreateContact);
